import "./App.css";

function Footer({ name }) {
  return (
    <footer class="footer">
      Designed & Developed by {name}(2&#x2764;&#xfe0f;24) Sri Vasavi Engg.
      College
    </footer>
  );
}

function App() {
  return (
    <>
      <div class="container-fluid">
        <h1 class="title">phishdefender</h1>
        <div class="content">
          <p>Protect yourself from phishing attacks!</p>
          <form action="#" method="post" class="form">
            <div class="form-group">
              <input
                type="text"
                class="form-control"
                placeholder="Enter URL"
                name="url"
                required
              />
            </div>
            <button type="submit" class="btn btn-primary submit-btn">
              Submit
            </button>
          </form>
        </div>
      </div>
      <Footer name={"Subhan Saheb Shaik"}></Footer>
    </>
  );
}

export default App;
